    false,nt"url": null,nt"notes": "Mussel Watch represents the longest running
    continuous contaminant monitoring program in U.S. coastal and Great Lakes waters
    and was created in response to concerns over environmental quality of the Nation's
    coastal and estuarine ecosystems. This project analyzes chemical and biological
    contaminant trends in sediment and bivalve tissue collected at over 280 coastal
    sites from 1986 to present. Parameters monitored include sediment and bivalve tissue
    chemistry for over 100 organic and inorganic contaminants; bivalve histology; and
    Clostridium perfringens (pathogen) concentrations. This project regularly quantifies
    PAHs, PCBs, chlorinated pesticides including DDT and its metabolites, TBT and its
    metabolites, and trace elements.",nt"license_title": null,nt"extras": [{ntt"key":
